content:
고작 졸피뎀 5mg 먹었다고 일하다 쓰러질 뻔해서;;;
이게 그렇게 독한 약인줄은 몰랐어요 진짜 어지러워서 흐느적거리다 팀장님한테 붙들려서 탕비실에 고이 넣어짐
심지어 그것도 일어나기 8시간 전에 먹은 건데....

@monstar_mon9 저 지금 졸피뎀 받아먹고 있는데...어쩐지
하루만 안먹어도 세상에 무너진것처럼
힘들더니 이유가 있었군요...세상에...

@lvrty__ 으아 졸피뎀을 두 알을 드셨네...
아무리 거지같은 일이 있어도 약놀하시는 빈도는 좀 줄이셔야 해요ㅜㅜ
아님 두 알 먹어도 별 느낌 안 온다고요 조심하세요...

@KEHEDUC 아 너무공감해요.
수면제 내성의존이나 부작용에 대해서는 당신보다 내가 백만배 잘알고 있을것이며, 
안피곤한거라는 소리하는놈들은 나같이 졸피뎀 풀용량먹고 불면으로 밤을 새워봐야돼 쉬ㅣ이이벌

@n36710646 하하... 잠이 오지 않기 때문에 졸피뎀을 먹고 있단다. 커피를 절대 마시지 말라는 정신과 의사의 당부가 있었기 때문일까... 카페인은 섭취하지 않으려 해. 

(어색하게... 웃어본다. 하하... 하하하.)

걱정 고맙구나.

@lvrty__ 헉 부작용맞아요🥲🥲
졸피뎀 진짜로 위험한 약이에요
오늘은 푹 쉬세요 제가꼬옥안아드림토닥토닥...

@deambuler_blue 괴로워 ⋯
아껴뒀던 졸피뎀을
먹어야겠어 ⋯

@jeongsingwa 저도 졸피뎀(스틸녹스)를 6-7년 정도 먹었던거 같아요.
정도의 차이가 있긴한데 최대 심했을때 두알 복용했습니다. 
센세와는 좀 차이가 많이 납니다.

@bbaddaddu2 졸피뎀을 알아보고나니 아무래도 신경이쓰이죠 다른건 무슨종류인지 모르겟으니까 폰으로 약모양 검색해서알아낼듯
검색결과보고 한숨좀쉬고 도로 잘 집어넣어요
안방침대에앉아있다가 엔도 나오는소리들리면 거실로나갈듯

@_jeongro 속합니다. 의존성이 낮은 약물에 속합니다.
  우리가 ‘졸피뎀’이라 부르는 건 ‘스틸녹스’란 상품명을 갖고 있는데, 지금은 특허가 만료되어 졸피뎀(산도스), 파마주석산졸피뎀(한국파마), 졸피신(명인), 졸피람(환인), 졸피드(한미) 등으로 카피약이 나오고 있습니다. 
올리신 약물은 ‘스틸녹스’ 즉,

@conspiring_girl 헉
기억안나는건 좀 글타
졸피뎀은 왜먹는거야?
